程序代码中定义了一个名为 `integer` 的类，该类包含一个构造函数 `integer(int value=0)` 和一个友元函数 `operator+(integer itg)`。此外，还有一个私有成员变量 `value` 和一个构造函数 `integer(int value=0)`。类的定义如下：

```cpp
#include<iostream>
using namespace std;

class integer {
public:
    integer(int value=0):value(value) {}
    integer operator+(integer itg) {
        return value += itg.value;
    }
    friend ostream& operator<<(ostream& os, integer& it) {
        return os << it.value;
    }
private:
    int value;
};

int main() {
    integer i;
    integer ii;
    ii = 2 + i;
    cout << "i=" << i << ", ii=" << ii << endl;
    return 0;
}
```

在编译时，程序会报错，因为 `integer` 类的构造函数 `integer(int value=0)` 和 `operator+(integer itg)` 都没有定义。在运行时，程序会输出 `i=0, ii=2`，因为 `ii` 的值是 `2 + i` 的结果，即 `2 + 2`，所以 `ii` 的值是 `2`。

因此，正确答案是：

A. i=0, ii=2

